import React, { useEffect, useState } from 'react';
import NewsItems from './NewsItems';
import Spinnar from './Spinnar';
import '../App';

export default function News(props) {
    let [data, setData] = useState([]);
    let [loading, setLoading] = useState(false);
    let [page, setPage] = useState(1);
    let [totalResults, settResutl] = useState(0);
    let [selectedLanguage, setSelectedLanguage] = useState('en'); // default to English

    const fetchData = async () => {
        props.setProgress(40);
        const url = `https://newsapi.org/v2/top-headlines?country=${props.country}&category=${props.category}&language=${selectedLanguage}&apiKey=YOUR_NEWS_API_KEY&page=${page}&pageSize=${props.pageSize}`;
        setLoading(true);

        const response = await fetch(url);
        const parsedData = await response.json();

        props.setProgress(70);
        setLoading(false);

        setData(parsedData.articles);
        settResutl(parsedData.totalResults);
        props.setProgress(100);
    };

    useEffect(() => {
        fetchData();
    }, [page, selectedLanguage]);

    const handleNextBtn = async () => {
        setPage(page + 1);
        fetchData();
    };

    const handlePrivesBtn = async () => {
        setPage(page - 1);
        fetchData();
    };

    const handleLanguageChange = (e) => {
        setSelectedLanguage(e.target.value);
    };

    return (
        <div className='container' style={{ marginTop: '100px' }}>
            <h1 className='text-center'>Kal-Tak {props.category}</h1>
            <div className='d-flex justify-content-center mb-3'>
                <select value={selectedLanguage} onChange={handleLanguageChange} className="form-select w-auto">
                    <option value="en">English</option>
                    <option value="hi">Hindi</option>
                    <option value="ta">Tamil</option>
                    <option value="te">Telugu</option>
                    <option value="ml">Malayalam</option>
                    <option value="kn">Kannada</option>
                    <option value="gu">Gujarati</option>
                    <option value="mr">Marathi</option>
                    <option value="bn">Bengali</option>
                    {/* Add more Indian languages as needed */}
                </select>
            </div>
            {loading && <Spinnar />}
            <div className='row'>
                {data.map((item, i) => (
                    <div className='col-md-4 my-3' key={i}>
                        <NewsItems element={item} />
                    </div>
                ))}
            </div>
            <div className='container d-flex justify-content-between'>
                <button disabled={page <= 1} type="button" onClick={handlePrivesBtn} className="btn btn-primary">&larr; Prives</button>
                <button disabled={page + 1 > Math.ceil(totalResults / props.pageSize)} type="button" onClick={handleNextBtn} className="btn btn-primary">Next &rarr;</button>
            </div>
        </div>
    );
}
